  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0108218 includes chemical,
  discrete sample, physical and profile data collected from HUDSON in the Davis Strait,
  Labrador Sea and North Atlantic Ocean from 2002-06-23 to 2002-07-19 and retrieved
  during cruise 18HU20020623 (HUD2002-032). These data include ALKALINITY, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon
  tetrachloride (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, NITRATE + NITRITE CONTENT (CONCENTRATION), PHOSPHATE, SALINITY,
  SILICATE, WATER TEMPERATURE and methyl chloroform (MC). The instruments used to
  collect these data include Alkalinity titrator, CTD, Coulometer for DIC measurement
  and bottle. These data were collected by Robert Gershey of BDR Research Ltd and
  Peter E. (retired) Jones of Bedford Institute of Oceanography as part of the CLIVAR_AR07W_2002
  data set.nnThe International CLIVAR Global Ocean Carbon and Repeat Hydrography Program
  carries out a systematic and global re-occupation of select WOCE/JGOFS hydrographic
  sections to quantify changes in storage and transport of heat, fresh water, carbon
  dioxide (CO2), and related parameters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
